echo count($files) . " files" .NL;
foreach($files as $key => $curFile) {
	if($urls) {
		if(substr($curFile, 0, 4) != 'http') {
			continue;
		}
		//echo $curFile . NL;
		$fbase = crc32($curFile);
		$srcFile = $curFile;
		$ext = 'jpg';
	} else {
		$parts = pathinfo($curFile);
		$ext = !empty($parts['extension']) ?	strtolower($parts['extension'])	:	'';
		$fbase = $parts['filename'];
		$srcFile = $srcPath . $curFile;
	}
	$destFile = $destPath . $prefix . 'face_' . $fbase . '.jpg';
	$destNone = $destPath . $prefix . 'face_' . $fbase . '.none';

	if(is_file($destFile) || is_file($destNone)) {
		continue;
	}
	if($ext != 'jpg') {
		continue;
	}
	//print_r($parts['filename']);
	//if($key > 50) { break; }
	echo "{$key} = {$srcFile}" . NL;
	$result = $face_detect->faceDetect($srcFile);
	if($result > 100) {
		$face_detect->toJpeg($destFile);
	} else {
		file_put_contents($destNone, $result);
	}
}

